import React from "react";
import "./second.css";
import Mx from "../../assets/mxplayer.png";
import Shemaro from "../../assets/shemaro.png";

export default function Second() {
  return (
    <div class="flex-container">
      <div class="flex-item-left">
        <img src={Mx} alt="" />
      </div>

      <div class="flex-item-right">
        <img src={Shemaro} alt="" />
      </div>
    </div>
  );
}
